import React from 'react';

const ItemCart = ({item}) => {
    return (
        <div>
            <thead>
                <th scope='col'>Producto:</th>
                <th scope='col'>Cantidad pedida:</th>
                <th scope='col'>Precio:</th>
            </thead>
            Producto:{item.name} Cantidad pedida:{item.amount} Precio:${item.price}
        </div>
    );
}

export default ItemCart;
